import React from 'react';
import PropTypes from 'prop-types';
import '../../assets/scss/components/SearchResult/SearchList.scss';

SearchList.propTypes = {
  resultData: PropTypes.array,
};

function SearchList(props) {
  const {resultData} = props;
  return (
    <div className='search__list'>
      {resultData.map((data) => (
        <div className='search__item' key={data.name}>
          <div className='search__thumbnail'>
            <img
              src={require(`../../assets/images/${data.image_url}`)}
              alt={data.name}
            />
          </div>

          <div className='search__info'>
            <h2 className='search__name'>{data.name}</h2>
            <p className='search__distance'>{data.distance}</p>
            <p className='search__tag'>{data.tag}</p>
            <p className='search__des'>{data.description}</p>
            <p className='search__type'>
              {data.free_cancel && 'Free cancellation'}
            </p>
            <p className='search__message'>
              {data.free_cancel &&
                'You can cancel later, so lock in this great price today!'}
            </p>
          </div>
          <div className='search__rating'>
            <div className='search__rate'>
              <p className='search__text'>{data.rate_text}</p>
              <p className='search__score'>{data.rate}</p>
            </div>
            <h2 className='search__price'>{data.price}</h2>
            <p className='search__text'>Include taxes and fees</p>
            <button className='search__btn'>See availability</button>
          </div>
        </div>
      ))}
    </div>
  );
}

export default SearchList;
